namespace Effort.Test.Features
{
    using System.Linq;
    using Effort.Test.Data.Northwind;
    using Effort.Test.Internal.Queries;
    using NUnit.Framework;

    [TestFixture]
    public class BinaryFixture
    {
        private IQueryTester<NorthwindObjectContext> tester;

        [SetUp]
        public void Initialize()
        {
            this.tester = new NorthwindQueryTester();
        }

        [Test]
        public void BinaryResult()
        {
            string expected = "[{\"Photo\":\"\"}]";

            ICorrectness result = this.tester.TestQuery(
                context =>
                    from employee in context.Employees
                    where employee.EmployeeID == 1
                    select employee.Photo, 
                expected);

            Assert.IsTrue(result.Check());
        }

        [Test]
        public void BinaryConstant()
        {
            string expected = "[{\"Photo\":\"\",\"C1\":\"AQID\"}]";

            ICorrectness result = this.tester.TestQuery(
                context =>
                    from employee in context.Employees
                    where employee.EmployeeID == 1
                    select new 
                    { 
                        Photo = employee.Photo, 
                        Dummy = new byte[] { 1, 2, 3 } 
                    },                   
                expected);

            Assert.IsTrue(result.Check());
        }

        [Test]
        public void BinaryParameter()
        {
            string expected = "[{\"Photo\":\"\",\"C1\":\"AQID\"}]";

            byte[] binary = new byte[] { 1, 2, 3 }; 

            ICorrectness result = this.tester.TestQuery(
                context =>
                    from employee in context.Employees
                    where employee.EmployeeID == 1
                    select new 
                    { 
                        Photo = employee.Photo, 
                        Dummy = binary 
                    },   
                expected);

            Assert.IsTrue(result.Check());
        }
    }
}
